import getPosts from '../helpers/getPosts';

export default function Posts(){

  const [posts,setPosts] = useState([]);
  useEffect( () => handlePosts(),[]);

  function handlePosts(){
    getPosts()

    .then( 
      (data) => {

        setPosts(data.posts)
      }
    )
    .catch( e => console.log(e))
  }
  let v =[];
  return(
    <div className='body'>
      <h1> POST</h1>
      {   

        v = posts.map(
          (post) => {
             <ul key={post.id}>
              <li>
                {post.body}
              </li>
             </ul>
          }
         )
      }   
    </div>
  );  
}
